import numpy as np
import matplotlib as mpl
import matplotlib.pyplot as plt


def plot_pretrain(all_data, label):
    data_num = len(all_data)
    pretrain_G_losses = all_data['pretrain_G_losses']

    print(pretrain_G_losses)
    epochs = len(pretrain_G_losses)

    x = np.array([i for i in range(epochs)])
    pretrain_G_losses = np.array(pretrain_G_losses)
    max_loss = max(pretrain_G_losses)
    min_loss = min(pretrain_G_losses)

    plt.title('pretrain G loss')

    plt.plot(x, pretrain_G_losses, color='cyan', label='loss')
    # plt.legend()
    plt.xlabel('epoch')
    plt.ylabel('loss')
    plt.axis([0, epochs+1, min_loss, max_loss])
    if label == 'mse':
        plt.savefig('pretrian_loss_mse.png')
    elif label == 'custome':
        plt.savefig('pretrian_loss_custome.png')
    else:
        plt.savefig('pretrian_loss_test.png')

    plt.show()
    plt.cla()
    plt.clf()
    plt.close()

